de:
Pont d'Ouilly Loisirs ist als "Centre Social", "Jeunesse et Sports", "Education Nationale" und "Economie Sociale et Solidaire" anerkannt und bietet ein vielfältiges Angebot an sportlichen und soziokulturellen Aktivitäten, das allen offen steht.

Die folgenden Grundsätze sollen die gemeinsame Grundlage für alle unsere Aktionen bilden:

-    Förderung des Zugangs zu sportlichen, erzieherischen, kulturellen und künstlerischen Freizeitaktivitäten für alle;
 -   Schaffung von sozialen Bindungen;
 -   Das kollektive Interesse über das individuelle Interesse stellen;
 -   Den Respekt vor Andersartigkeit in das Herz unserer Aktionen integrieren;
 -   An der Animation der Region teilnehmen;
 -   Die Freude an Anstrengung und Leistung fördern, ohne sie zu einer absoluten Priorität zu machen;
 -   Die soziale Mischung fördern;
 -   Die Mitglieder einbeziehen und ihnen Verantwortung übertragen, um eine gemeinsame Führung zu ermöglichen.

Acht große Prinzipien, von denen jedes Mitglied und jeder Arbeitnehmer überzeugt sein muss, die aber auch gelebt werden müssen.

Die Mitglieder und die Bewohner stehen im Mittelpunkt des Projekts der Organisation. Um dies zu erreichen, müssen die Aktionen des Vereins den Einwohnern von Pont d'Ouilly und den umliegenden Gemeinden ermöglichen, sich zu informieren, sich zu entfalten, Ideen zu teilen, Bekanntschaften zu machen, eine Dynamik der Solidarität zu erzeugen und durch Freiwilligenarbeit zu handeln.

Der Verein "Pont d'Ouilly Loisirs" organisiert Freizeitaktivitäten im Bereich der lokalen Animation (z. B. Animationen, Veranstaltungen und Freizeitaktivitäten für die lokale Bevölkerung in den Bereichen Sport, Kultur und Bildung) sowie im Bereich der sportlichen Betätigung (u. a. Kanuverleih, Hochseilgarten, betreute Sportaktivitäten, Gruppenunterkünfte).

Neben dem Freizeitzentrum betreibt der Verein ein "Maison des Habitants" (Haus der Einwohner), das ein Ort des Empfangs, der Animationen und der Sprechstunden verschiedener Partner (Secours populaire, Mission Locale, RAM,) sein soll.
POL ist eine Sport-, Freizeit-, Tourismus-, Kinder-/Jugend- und seit kurzem auch eine Familienstruktur Von nun an ist POL eine soziale Struktur, die als solche wahrgenommen wird.

en:
Through its various "Social Center", "Youth and Sports", "National Education" and "Social and Solidarity Economy" accreditations, Pont d'Ouilly Loisirs aims to offer a diverse range of sporting and socio-cultural activities open to all.

The following principles must be the common base of all our actions:

-    To promote the accessibility of sports, educational, cultural and artistic leisure for all;
 -   Create social ties;
 -   To give priority to the collective interest over the individual interest;
 -   To integrate the respect of the difference in the heart of our actions;
 -   To participate in the animation of the territory;
 -   Promote a taste for effort and performance, without making this an absolute priority;
 -   Promote social diversity;
 -   Involve and empower members to allow a shared governance.

Eight key principles that every member, every employee, must not only be convinced of, but also live by.

Members and residents are at the heart of the association?s project. To achieve this, the association?s actions must enable the residents of Pont d?Ouilly and surrounding communities to get informed, develop, share ideas, meet new people, generate a dynamic of solidarity and take action through volunteering.

The aim of the Pont d'Ouilly Loisirs association is to organize leisure activities in the field of local entertainment (such as sporting, cultural and educational events and leisure activities for the local population), as well as sporting activities (including, but not limited to, canoe hire, high ropes courses, supervised sporting activities and group accommodation).

In addition to its leisure center, the association also runs a "Maison des Habitants" (residents' center), a place where various partners (Secours populaire, Mission Locale, RAM, etc.) can meet, organize events and set up offices.
A sports facility, a leisure facility, a tourist facility, a children/youth and family facility? From now on, POL is a social structure that is assumed and claimed as such.

it:
Attraverso i suoi vari accreditamenti di "Centro sociale", "Gioventù e sport", "Educazione nazionale" e "Economia sociale e solidale", Pont d'Ouilly Loisirs si propone di offrire una gamma diversificata di attività sportive e socioculturali aperte a tutti.

I seguenti principi devono essere la base comune di tutte le nostre attività:

-    Promuovere l'accesso alle attività sportive, educative, culturali e artistiche del tempo libero per tutti;
 -   Creare legami sociali;
 -   Privilegiare l'interesse collettivo rispetto a quello individuale;
 -   Integrare il rispetto per le differenze nel cuore delle nostre attività;
 -   Contribuire alla comunità locale;
 -   Promuovere il gusto per l'impegno e la performance, senza farne una priorità assoluta;
 -   Incoraggiare un mix sociale;
 -   Coinvolgere e responsabilizzare i soci per consentire una governance condivisa.

Otto principi chiave di cui ogni socio, ogni dipendente, deve non solo essere convinto, ma anche vivere.

I soci e i residenti sono al centro del progetto dell'associazione. Per questo, le attività dell'associazione devono permettere agli abitanti di Pont d'Ouilly e delle comunità circostanti di informarsi, svilupparsi, condividere idee, conoscere nuove persone, creare una dinamica di solidarietà e agire attraverso il volontariato.

L'obiettivo dell'associazione Pont d'Ouilly Loisirs è quello di organizzare attività ricreative che rientrano nell'ambito delle attività locali (come eventi sportivi, culturali ed educativi e attività ricreative per la popolazione locale) e attività sportive (tra cui, ma non solo, noleggio di canoe, corsi di corde alte, attività sportive supervisionate e alloggi per gruppi).

Oltre al centro ricreativo, l'associazione gestisce una "Maison des Habitants", che vuole essere un luogo in cui i vari partner (Secours populaire, Mission Locale, RAM, ecc.) possono incontrarsi, organizzare eventi ed essere a disposizione.
Un centro sportivo, un centro ricreativo, un centro turistico, un centro per bambini/giovani e famiglie? La POL è ormai una struttura sociale che ha assunto questo ruolo e ne è orgogliosa.

fr:
Au travers de ses divers agréments « Centre Social », « Jeunesse et Sports », « Education Nationale » et « Economie Sociale et Solidaire », Pont d’Ouilly Loisirs souhaite proposer une offre diversifiée d’activités sportives et socioculturelles ouverte à tous.

Les principes suivants doivent être le socle commun de toutes nos actions:

-    Favoriser l’accessibilité des loisirs sportifs, éducatifs, culturels et artistiques pour tous;
 -   Créer du lien social;
 -   Privilégier l’intérêt collectif sur l’intérêt individuel;
 -   Intégrer le respect de la différence au cœur de nos actions;
 -   Participer à l’animation du territoire;
 -   Prôner le goût de l’effort et de la performance, sans en faire une priorité absolue;
 -   Favoriser la mixité sociale;
 -   Impliquer, responsabiliser les adhérents pour permettre une gouvernance partagée.

Huit grands principes dont chaque adhérent, chaque salarié, doit à la fois être convaincu mais également les faire vivre.

L’adhérent et l’habitant sont au cœur du projet de l’association. Pour ce faire, les actions de l’association doivent permettre aux habitants de Pont d’Ouilly et des communes environnantes de s’informer, de s’épanouir, de partager des idées, de faire des rencontres, de produire une dynamique de solidarité et d’agir par l’intermédiaire du bénévolat.

Ainsi, l’association « Pont d’Ouilly Loisirs » a pour objet d’organiser des activités de loisirs s’inscrivant à la fois dans le champ de l’animation locale (telles que des animations, manifestations et loisirs à destination de la population locale, qu’ils soient sportifs, culturels et éducatifs) mais également dans le champ de la pratique sportive (de manière non exhaustive : location de canoës, Parc Acrobatique en Hauteur, activités sportives encadrées, hébergements collectifs,).

En parallèle de sa Base de loisirs, l’association gère une « Maison des Habitants » qui se veut être un lieu d’accueil, d’animations et de permanences de différents partenaires (Secours populaire, Mission Locale, RAM,).
Structure sportive, structure de loisirs, structure touristique, structure enfance/jeunesse et famille depuis peu… Désormais, POL est une structure sociale assumée et revendiquée comme telle.

nl:
Pont d'Ouilly Loisirs wil via zijn verschillende erkenningen "Sociaal Centrum", "Jeugd en Sport", "Nationaal Onderwijs" en "Sociale en Solidaire Economie" een gevarieerd aanbod van sportieve en sociaal-culturele activiteiten aanbieden die voor iedereen toegankelijk zijn.

De volgende principes moeten de gemeenschappelijke basis vormen voor al onze activiteiten:

-    De toegang tot sportieve, educatieve, culturele en artistieke vrijetijdsactiviteiten voor iedereen bevorderen;
 -   Sociale banden creëren;
 -   Voorrang geven aan het collectieve belang boven het individuele belang;
 -   Respect voor verschillen integreren in het hart van onze activiteiten;
 -   Bijdragen aan de lokale gemeenschap;
 -   De smaak van inspanning en prestatie bevorderen, zonder dit tot een absolute prioriteit te maken;
 -   Een sociale mix aanmoedigen;
 -   De leden betrekken en mondig maken om gedeeld bestuur mogelijk te maken.

Acht sleutelbeginselen waarvan elk lid, elke werknemer, niet alleen overtuigd moet zijn, maar ook naar moet leven.

Leden en bewoners staan centraal in het project van de vereniging. Om dit te bereiken moeten de activiteiten van de vereniging de inwoners van Pont d'Ouilly en de omliggende gemeenschappen in staat stellen zich te informeren, zich te ontwikkelen, ideeën uit te wisselen, nieuwe mensen te ontmoeten, een dynamiek van solidariteit te creëren en actie te ondernemen via vrijwilligerswerk.

Het doel van de vereniging "Pont d'Ouilly Loisirs" is het organiseren van vrijetijdsactiviteiten op het gebied van plaatselijke ontspanning (zoals evenementen en vrijetijdsactiviteiten voor de plaatselijke bevolking, zowel sportief, cultureel als educatief) en ook op het gebied van sport (waaronder, maar niet beperkt tot, kanoverhuur, hoog touwenparcours, sportactiviteiten onder begeleiding, groepsaccommodatie).

Naast het recreatiecentrum beheert de vereniging een "Maison des Habitants", een plaats waar verschillende partners (Secours Populaire, Mission Locale, RAM, enz.) elkaar kunnen ontmoeten, evenementen kunnen organiseren en aanwezig kunnen zijn.
Een sportcentrum, een vrijetijdscentrum, een toeristisch centrum, een kinder-/jeugd- en gezinscentrum? POL is nu een sociale structuur die deze rol op zich heeft genomen en er trots op is.

es:
A través de sus diversas acreditaciones de "Centro Social", "Juventud y Deportes", "Educación Nacional" y "Economía Social y Solidaria", Pont d'Ouilly Loisirs pretende ofrecer una variada gama de actividades deportivas y socioculturales abiertas a todos.

Los siguientes principios deben ser la base común de todas nuestras actividades:

-    Promover el acceso a actividades de ocio deportivas, educativas, culturales y artísticas para todos;
 -   Crear vínculos sociales;
 -   Dar prioridad al interés colectivo sobre el individual;
 -   Integrar el respeto a las diferencias en el núcleo de nuestras actividades;
 -   Contribuir a la comunidad local;
 -   Promover el gusto por el esfuerzo y el rendimiento, sin que ello constituya una prioridad absoluta;
 -   Fomentar una mezcla social;
 -   Implicar y capacitar a los miembros para permitir una gobernanza compartida.

Ocho principios clave de los que cada miembro, cada empleado, no sólo debe estar convencido, sino también vivir.

Los miembros y residentes son el centro del proyecto de la asociación. Para ello, las actividades de la asociación deben permitir a los habitantes de Pont d'Ouilly y sus alrededores informarse, desarrollarse, compartir ideas, conocer gente nueva, crear una dinámica de solidaridad y actuar a través del voluntariado.

El objetivo de la asociación Pont d'Ouilly Loisirs es organizar actividades de ocio que se inscriban en el marco de las actividades locales (como eventos deportivos, culturales y educativos y actividades de ocio para la población local), así como actividades deportivas (entre otras, alquiler de canoas, cursos de cuerdas altas, actividades deportivas dirigidas y alojamiento para grupos).

Paralelamente a su centro de ocio, la asociación gestiona una "Maison des Habitants" (Casa de los Habitantes), que pretende ser un lugar de encuentro, organización de actos y proximidad para los distintos socios (Secours populaire, Mission Locale, RAM, etc.).
¿Un polideportivo, un centro de ocio, un centro turístico, un centro infantil/juvenil y familiar? POL es ahora una estructura social que ha asumido este papel y está orgullosa de ello.
